import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

  newTaskName: string = '';
  tasks: string[] = [];

  addTask() {
    if (this.newTaskName.trim() !== '') {
      this.tasks.push(this.newTaskName);
      this.newTaskName = '';
    }
  }

}
